import React, { useState } from 'react';

const App = () =>{

  const newTime  = new Date().toLocaleTimeString();

  const [currTime, setCTime] = useState(newTime);

    const UpdatedTime = () =>{
      newCTime  = new Date().toLocaleTimeString();
      setCTime(newTime);
    }

  return(
    <>
      <div>
        <h1>{currTime}</h1>
        <button onClick={UpdatedTime}> Get Time </button>
      </div>
    </>
  )
}

export default App;
